import React from 'react'
import Explorer from './svgs/Explorer';
import Globe from './svgs/Globe';

export default function Tokenlinks(props) {
    var tklnks=[]

    tklnks.push(
        <a rel="noreferrer" target="_blank" href={`https://explorer.kardiachain.io/token/${props.id}`}>
            <div className=" sidelink bl m-b-9">
                <Explorer/>
                <span className="sidelink-text ab-l-m m-l-50 t-bl fs-16 noselect">View in Explorer</span>
            </div>
        </a>
    )
    if(props.website!="" || props.website!=undefined)
    return (
        <div className="section">
            {tklnks}
        <div className=" sidelink bl m-b-0">
            <Globe/>
            <span className="sidelink-text ab-l-m m-l-50 t-bl fs-16 noselect">View Website</span>
        </div>
    </div>
    )
}
